    data: |
      SELECT DISTINCT - + cor1.col0 FROM tab0 (FORMAT parquet) AS cor0 CROSS JOIN tab1 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab1

outputs:
  - name: q5351.out
    data: |
      -3
      -64
      -80
